import ReactDOM from 'react-dom'

class App extends React.Component {
  constructor(props) {
    super(props)
    this.state = {
      reminders: [
        {
          name: 'Buy some eggs',
          timestamp: "2018-11-10T13:00:00.141Z"
        }
      ],
      newName: ''
    }
  }

  render() {
    <div>
      debug: {this.state.newName}
    </div>
    return (
      <div>
        <h2>Reminders</h2>
        <form>
          <div>
            Name: <input />
          </div>
          <div>
            <button type="submit">Add</button>
          </div>
        </form>
        <h2>At time:</h2>
        ...
      </div>
    )
  }
}

// export default App

ReactDOM.render(
  <App />,
  document.getElementById('root')
)
